<h2 style="margin: 0">4</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Korean Red 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 Extract Attenuates 3 - Nitropropionic Acid-Induced Huntington's-Like Symptoms . Korean red ginseng ( KRG ) possesses neuroprotective activity . However , the potential neuroprotective value of KRG for the striatal toxicity is largely unknown . We investigated whether KRG extract ( KRGE ) could have a neuroprotective effect in a 3 - nitropropionic acid - ( 3 - NP ) induced ( i . p . ) Huntington ' s disease ( HD ) model . KRGE ( 50 , 100 , and 250 mg / kg / day , p . o . ) was administrated 10 days before 3 - NP injection ( pre-administration ) , from the same time with 3 - NP injection ( co-administration ) , or from the peak point of neurological impairment by 3 - NP injection ( post-administration ) . Pre-administration of KRGE produced the greatest neuroprotective effect in this model . Pre-administration of KRGE significantly decreased 3 - NP-induced neurological impairment , lethality , lesion area , and neuronal loss in the 3 - NP-injected striatum . KRGE attenuated microglial activation and phosphorylation of mitogen-activated protein kinases ( MAPKs ) and nuclear factor-kappa B ( NF-B ) signal pathway . KRGE also reduced the level of mRNA expression of tumor necrosis factor-alpha , interleukin - ( IL - ) 1 , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 , inducible nitric oxide synthase , and OX - 42 . Interestingly , the intrathecal administration of SB203580 ( a p38 inhibitor ) or PD98059 ( an inhibitor of MAPK Kinase , MEK ) increased the survival rate in the 3 - NP-induced HD model . Pre-administration of KRGE may effectively inhibit 3 - NP-induced striatal toxicity via the inhibition of the phosphorylation of MAPKs and NF-B pathways , indicating its therapeutic potential for suppressing Huntington's-like symptoms .</div>

<h2 style="margin: 0">5</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Gene-based vaccines and immunotherapeutics . DNA vaccines , comprised of plasmid DNA encoding proteins from pathogens , allergens , and tumors , are being evaluated as prophylactic vaccines and therapeutic treatments for infectious diseases , allergies , and cancer ; plasmids encoding normal human proteins are likewise being tested as vaccines and treatments for autoimmune diseases . Examples of in vivo prophylaxis and immunotherapy , based on different types of immune responses ( humoral and cellular ) , in a variety of disease models and under evaluation in early phase human clinical trials are presented . Viral vectors continue to show better levels of expression than those achieved by DNA plasmid vectors . We have focused our clinical efforts , at this time , on the use of recombinant viral vectors for both vaccine as well as cytokine gene transfer studies . We currently have four clinical programs in cancer immunotherapy . Two nonspecific immunotherapy programs are underway that apply adenoviral vectors for the transfer of cytokine genes into tumors in situ . An adenovirus-IFN gamma construct ( TG1042 ) is currently being tested in phase II clinical trials in cutaneous lymphoma . A similar construct , adenovirus -

<div class="entities" style="line-height: 2.5; direction: ltr">Meta-analysis of oral DB00669 therapy for migraine : number needed to treat and relative cost to achieve relief within 2 hours . OBJECTIVE : To determine the cost-effectiveness of the

 / 1D agonists , or triptans , in the acute treatment of migraine . METHODS : To determine the cost-effectiveness of the triptans , a meta-analysis was conducted of the efficacy data from 27 oral DB00669 trials , using the endpoint of &quot; pain-free &quot; status within 2 hours after initial dosing as the indicator of efficacy . Efficacy data were used to determine the number needed to treat (

 ) to achieve pain-free status in 1 patient within 2 hours postdose and then applied the per-dose costs for each DB00669 to the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 values . RESULTS : Rizatriptan 10 mg and almotriptan 12.5 mg were the most cost-effective of the triptans , costing $ 48.34 and $ 48.57 US dollars , respectively , to achieve pain-free status in 1 patient within 2 hours postdose .

<h2 style="margin: 0">11</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Generation of Epstein-Barr virus-specific cytotoxic T lymphocytes resistant to the immunosuppressive drug tacrolimus ( FK506 ) . Adoptive transfer of autologous Epstein-Barr virus-specific cytotoxic T lymphocytes ( EBV-CTLs ) to solid organ transplant ( SOT ) recipients has been shown safe and effective for the treatment of EBV-associated posttransplantation lymphoproliferative disorders ( PTLDs ) . SOT recipients , however , require the continuous administration of immunosuppressive drugs to prevent graft rejection , and these agents may significantly limit the long-term persistence of transferred EBV-CTLs , precluding their use as prophylaxis .

 ( FK506 ) is one of the most widely used immunosuppressive agents in SOT recipients , and its immunosuppressive effects are largely dependent on its interaction with the 12 - kDa FK506 - binding protein (

 ) . We have knocked down the expression of

 in EBV-CTLs using a specific small interfering RNA ( siRNA ) stably expressed from a retroviral vector and found that 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 - silenced EBV-CTLs are FK506 resistant . These cells continue to expand in the presence of the drug without measurable impairment of their antigen specificity or cytotoxic activity . We confirmed their FK506 resistance and anti-PTLD activity in vivo using a xenogenic mouse model , suggesting that the proposed strategy may be of value to enhance EBV-specific immune surveillance in patients at high risk of PTLD after transplantation .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Role of xanthine oxidoreductase and NAD ( P ) H oxidase in endothelial superoxide production in response to oscillatory shear stress . Oscillatory shear stress occurs at sites of the circulation that are vulnerable to atherosclerosis . Because oxidative stress contributes to atherosclerosis , we sought to determine whether oscillatory shear stress increases endothelial production of reactive oxygen species and to define the enzymes responsible for this phenomenon . Bovine aortic endothelial cells were exposed to static , laminar ( 15 dyn / cm2 ) , and oscillatory shear stress ( + / - 15 dyn / cm2 ) . Oscillatory shear increased superoxide ( O2 . - ) production by more than threefold over static and laminar conditions as detected using electron spin resonance ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) . This increase in O2 * - was inhibited by oxypurinol and culture of endothelial cells with tungsten but not by inhibitors of other enzymatic sources . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 also prevented H2O2 production in response to oscillatory shear stress as measured by dichlorofluorescin diacetate and Amplex Red fluorescence . DB02134 - dependent O2 * - production was increased in homogenates of endothelial cells exposed to oscillatory shear stress . This was associated with decreased xanthine dehydrogenase ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) protein levels and enzymatic activity resulting in an elevated ratio of xanthine oxidase ( XO ) to 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P47989
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>

 . We also studied endothelial cells lacking the p47phox subunit of the NAD ( P ) H oxidase . These cells exhibited dramatically depressed O2 * - production and had minimal XO protein and activity . Transfection of these cells with p47phox restored XO protein levels . Finally , in bovine aortic endothelial cells , prolonged inhibition of the NAD ( P ) H oxidase with apocynin decreased XO protein levels and prevented endothelial cell stimulation of O2 * - production in response to oscillatory shear stress . These data suggest that the NAD ( P ) H oxidase maintains endothelial cell XO levels and that XO is responsible for increased reactive oxygen species production in response to oscillatory shear stress .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Interpretation of point-of-care INR results in patients treated with dabigatran . BACKGROUND : Point-of-care devices for measurement of the international normalized ratio ( INR ) are commonly used to monitor therapy and maintain therapeutic levels of anticoagulation in patients treated with vitamin K antagonists .

</mark>

 , a new oral , reversible direct thrombin inhibitor approved for stroke prevention in patients with atrial fibrillation does not require routine coagulation monitoring . However , case reports have identified falsely elevated point-of-care INR levels in patients treated with dabigatran using one of these devices ( Hemochron ) . This in vitro study was designed to verify this issue . METHODS : We compared INR levels in whole blood and plasma using a Hemochron Jr . Signature + point-of-care device ( International Technidyne Corporation , Edison , NJ ) with routine laboratory monitoring , using blood from healthy volunteers that was spiked with increasing concentrations of dabigatran . RESULTS : 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 time and INR levels were increased about 2 - to 4 - fold with the point-of-care device compared with laboratory measures across the plasma dabigatran concentration range 50-1400 ng / mL . At plasma concentrations of dabigatran likely to be observed in patients , at a dose of 150 mg twice daily ( 60-275 ng / mL ) , whole blood point-of-care INR values increased from 1.7 to 4.0 , versus 1.1 to 1.5 measured with the laboratory coagulometer . Similar differences in prothrombin time were observed in plasma samples . CONCLUSIONS : INR levels in patients taking dabigatran are substantially higher using a Hemochron Jr . point-of-care device compared with laboratory values . We discourage the use of these devices specifically , as well as the use of the INR in general , for measuring the anticoagulant effect of dabigatran .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">DB02134 oxidase inhibitor tungsten prevents the development of atherosclerosis in ApoE knockout mice fed a Western-type diet . Hyperlipidemia enhances xanthine oxidase ( XO ) activity . XO is an important source of reactive oxygen species ( ROS ) . Since ROS are thought to promote atherosclerosis , we hypothesized that XO is involved in the development of atherosclerosis . ApoE ( - / - ) mice were fed a Western-type ( WD ) or control diet . In subgroups , tungsten ( 700 mg / L ) was administered to inhibit XO . XO is a secreted enzyme which is formed in the liver as xanthine dehydrogenase ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) and binds to the vascular endothelium . High expression of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 was found in the liver and WD increased liver 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P47989

 mRNA and

    P47989
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 protein expression . WD induced the conversion of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 to the radical-forming XO . Moreover , WD increased the hepatic expression of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 , demonstrating activation of hepatic cells . Aortic tissue of ApoE ( - / - ) mice fed a WD for 6 months exhibited marked atherosclerosis , attenuated endothelium-dependent relaxation to acetylcholine , increased vascular oxidative stress , and mRNA expression of the chemokine KC . Tungsten treatment had no effect on plasma lipids but lowered the plasma XO activity . In animals fed a control diet , tungsten had no effect on radical formation , endothelial function , or atherosclerosis development . In mice fed a WD , however tungsten attenuated the vascular superoxide anion formation , prevented endothelial dysfunction , and attenuated KC mRNA expression . Most importantly , tungsten treatment largely prevented the development of atherosclerosis in the aorta of ApoE ( - / - ) mice on WD . Therefore , tungsten , potentially via the inhibition of XO , prevents the development of endothelial dysfunction and atherosclerosis in ApoE ( - / - ) mice on WD .</div>
